export default async function Home() {
  const response = await fetch("https://pokeapi.co/api/v2/pokedex/2/")
  const data = await response.json()

  data.map((pokemon) => {
    ;<li key={pokemon.entry_number}></li>
  })

  return (
    <div>
      <ul>
        <li></li>
      </ul>
    </div>
  )
}
